import React from 'react';

export default function BasketSection({ value, selectedProducts, addToSelectedProducts }) {
    return (
        value && (
            <section className="AnotherSection">
               {selectedProducts.map((product) => (
                    <li key={product.id}>{product.title}</li>
                ))}
            </section>
        )
    );
}
